Text:
Äran ska inte gå till mig utan personen som ursprungligen laddade upp skivorna på TPB, torrenten verkar dock ha försvunnit så jag laddade upp på nytt. Min första torrent för övrigt och en uppmaning till er alla, det är lättare att ladda upp en torrent än vad man kan tro...

Mycket av min LP-sammling består i övrigt av ganska mainstream-progg såsom blå tåget, FNL-grupperna, Nynningen, osv så jag tror inte att jag kan bidra så mycket mer då det mesta redan finns uppladdat... :) Förslag på schysta band, requestsa uppladdning eller förslag på schysta butiker som säljer bra skivor i sthlms-området via pm uppskattas dock! ;)

// dsrcmusic
